import React, { Component } from "react";
import ParkComponent from "./ParkComponent.js";
import "./Home.css";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      ParkImages: [],
      parkCode: "",
      park: ""
    };
  }
  componentDidMount() {
    let url =
      "https://developer.nps.gov/api/v1/parks?statecode=AK&api_key=y010UOulh2F9R7ahrlYpcyXUEJltY7vRei1uVxpe";
    fetch(url)
      .then(res => res.json())
      .then(res => {
        console.log(res);
        this.setState({
          park: res.data
        });
      });
  }

  render() {
    console.log("Home loaded");
    return (
      <div className="component">
        <ParkComponent />
      </div>
    );
  }
}

export default Home;
